INSERT INTO `gejala` (`kode_gejala`, `nama_gejala`, `pertanyaan`) VALUES
(1, 'Menggaruk badan berlebihan', 'Apakah anjing anda menggaruk badan secara berlebihan?'),
(2, 'Bulu Rontok', 'Apakah anjing anda mengalami bulu rontok?'),
(3, 'Kulit terlihat kering', 'Apakah kulit anjing anda terlihat kering?'),
(4, 'Kulit Anjing memerah bersisik seperti iritasi yang membuat bentuk lingkaran.', 'Apakah kulit anjing anda memerah bersisik seperti iritasi yang berbentuk lingkaran?'),
(5, 'Terdapat luka yang akan membentuk kerak tebal yang berwarna abu - abu yang muncul pada area tertentu, seperti kepala, atau punggung anjing', 'Apakah kulit anjing anda terdapat luka berbentuk kerak tebal berwarna abu - abu yang muncul pada area seperti kepala atau punggung anjing?'),
(30, 'Luka pada bibir', 'Apakah terdapat luka pada bibir?'),
(6, 'Kerontokan bulu berbentuk lingkaran', 'Apakah kerontokan bulu berbentuk lingkaran?'),
(7, 'Kulit mengelupas', 'Apakah kulit anjing mengelupas?'),
(8, 'Pinggir telinga ada kerak berwarna putih', 'Apakah pinggir telinga anjing ada kerak berwarna putih?'),
(9, 'Adanya benjolan yang bentuknya cekung di tubuh Anjing', 'Apakah terdapat benjolan cekung di tubuh anjing?'),
(10, 'Dehidrasi', 'Apakah anjing anda mengalami dehidrasi?'),
(11, 'Nafsu makan berkurang', 'Apakah nafsu makan anjing anda berkurang?'),
(12, 'Kulit ruam - ruam (bentol - bentol)', 'Apakah kulit anjing anda mengalami ruam - ruam atau bentol - bentol?'),
(13, 'Anjing menggaruk bagian diantara kepala dan leher', 'Apakah anjing anda menggaruk antara leher dan kepala?'),
(14, 'Kulit disekitar leher memerah', 'Apakah kulit disekitar leher memerah?'),
(15, 'Bulu pada ekor Anjing tipis dan rontok', 'Apakah bulu pada ekor anjing tipis dan rontok?'),
(16, 'Ekor Anjing berminyak dan berbau', 'Apakah ekor anjing berminyak dan berbau?'),
(17, 'Keluar cairan kecoklatan dari ekor Anjing', 'Apakah keluar cairan kecoklatan dari ekor anjing?'),
(18, 'Terdapat kutu yang menyerupai debu pada bulu Anjing', 'Apakah terdapat kutu yang menyerupai debu pada bulu anjing?'),
(19, 'Bulu Anjing berwarna pucat', 'Apakah bulu anjing berwarna pucat?'),
(20, 'Bulu pada bagian ekor Anjing dekat kemaluan botak atau menipis', 'Apakah bulu bagian ekor anjing dekat kemaluan botak atau menipis?'),
(21, 'Demam', 'Apakah anjing anda demam?'),
(22, 'Terdapat bintik merah pada kulit Anjing area dagu', 'Apakah terdapat bintik merah pada kulit anjing area dagu?'),
(23, 'Terdapat lobang benjolan bekas bintik jerawat', 'Apakah terdapat lobang benjolan bekas bintik jerawat?'),
(24, 'Adanya bintik hitam', 'Apakah terdapat bintik hitam?'),
(25, 'Kulit sekitar telinga Anjing berlobang, berjamur dan berkerak', 'Apakah kulit sekitar telinga kuinng berlobang, berjamur, dan berkerak?'),
(26, 'Mengeluarkan nanah', 'Apakah mengeluarkan nanah?'),
(27, 'Menggaruk bagian belakang telinga', 'Apakah anjing menggaruk di bagian belakang telinga?'),
(28, 'Benjolan seperti bisul yang membengkak di area kepala, kaki depan, ekor atau pinggang', 'Apakah terdapat benjolan seperti bisul yang membengkan di area kepala, kaki depan, ekor, atau pinggang?'),
(29, 'Benjolan di kulit', 'Apakah terdapat benjolan di kulit?'),
(31, 'Kulit berminyak', 'Apakah kulit berminyak?'),
(32, 'Menggaruk di bagian kepala', 'Apakah anjing menggaruk di bagian kepala?'),
(33, 'Jamur dikulit', 'Apakah terdapat jamur dikulit?'),
(34, 'Telinga Berkerak', 'Apakah telinga anjing berkerak?'),
(35, 'Lapisan kulit putih di bulu', 'Apakah terdapat lapisan kulit putih di bulu?');
