INSERT INTO `penyakit` (`kode_penyakit`, `nama_penyakit`, `det_penyakit`, `srn_penyakit`, `gambar`) VALUES
(1, 'Ringworm', '', 'Pemberian antijamur topikal jika infeksi masih tergolong ringan dengan menggunakan cream atau penggunaan medicated shampoo yang mengandung antijamur atau sulfur. Pengobatan secara topikal dengan syarat harus mencukur rambut di area lesi agar obat dapat langsung mengenai kulit. Sebelumnya dioleskan obat topikal, terlebih dahulu kerak pada lesi dibersihkan dengan antiseptik.\r\nPada kasus yang berat penggunaan antijamur diberikan baik secara topikal (cream, obat oles, shampoo) maupun oral (Itraconaz', '01 Ringworm.jpg'),
(2, 'Scabies (Kudis Anjing)', '', '1.	Cuci dan bersihkan alat-alat grooming seperti sikat, sisir, kandang, semua peralatan dan tempat yang sering digunakan anjing. \r\n2.	Hindari tempat grooming atau penitipan hewan yang tidak mempunyai kebersihan yang cukup baik. \r\n3.	Mandikan anjing dengan shampo yang mengandung zat sulfur seperti lime sulfur atau sebasol.\r\n4.	Oleskan salep yang mempunyai kandungan permethrin, petrolatum, triamcolone, dermatech dan gamexane. \r\n5.	Berikan injeksi atau suntik anti scabies, yang hanya dapat ditangan', '02 Scabies.jpg'),
(3, 'Alergic Dhermatitis (Alergi Kulit)', '', '1.	Cuci dan bersihkan alat-alat grooming seperti sikat, sisir, kandang, semua peralatan dan tempat yang sering digunakan anjing. \r\n2.	Hindari tempat grooming atau penitipan hewan yang tidak mempunyai kebersihan yang cukup baik. \r\n3.	Mandikan anjing dengan shampo yang mengandung zat sulfur seperti lime sulfur atau sebasol. \r\n4.	Oleskan salep yang mempunyai kandungan dermatech, ketoconazole, dan miconazole. \r\n5.	Berikan injeksi atau suntik yang hanya dapat ditangani oleh dokter hewan.\r\n', '03 Alergic Dhermatitis.jpg'),
(4, 'Stud Tail (Kelenjar pada ekor anjing', '', 'Cara mengatasi permasalahan ini adalah dengan mencuci lebih sering bagian yang terjangkit dengan sampo anjing yang mengandung zat tertentu untuk mengurangi produksi minyak berlebih pada anjing tersebut.', '04 Stud Tail.jpg'),
(5, 'Cat Lice (kutu anjing atau pijal)', '', '1.	Siapkan Minyak VCO Dan propolis.\r\n2.	Oleskan pada area infeksi.\r\n3.	Tambahkan tetesan Propolis setelahnya.\r\n4.	Lalu oleskan agar merata\r\n5.	Bila tidak kunjung sembuh, berikan suntikan anti parasit.\r\n', '05 Cat Lice.jpg'),
(6, 'Feline Acne (Jerawat Anjing)', '', 'Disarankan untuk selalu mebersihkan tempat makanan anjing agar peliharaan anda terhindar dari penyakit kulit jenis ini. Gunakan berbagai suplemen anjing yang memiliki kandungan omega 6 atau omega 3 untuk proses penyembuhan. Dan jangan menggunakan sampo anjing yang memiliki kandungan zat berbahaya.', '06 Feline Acne.png'),
(7, 'Ear Mite (Kutu Telinga)', '', 'Pengobatannya bisa dilakukan dengan obat tetes dan dibersihkan dengan cotton bud. Penyakit ini tergolong menular antaranjing, sehingga pengobatannya lebih baik dilakukan secara terpisah.', '07 Ear Mite.jpg'),
(8, 'Abses', '', 'Terapi antibiotik yang tepat merupakan komponen penting dari keberhasilan pengobatan abses, di mana pun lokasinya. Antibiotik akan dipilih berdasarkan bakteri yang terlibat, dan lamanya pengobatan akan tergantung pada bakteri dan lokasi abses. Dokter hewan biasanya akan merekomendasikan agar sampel nanah dikirim ke laboratorium rujukan untuk dibiakkan sehingga bakteri yang terlibat dapat diidentifikasi dan antibiotik yang sesuai dapat dipilih.\r\nPenting untuk memberikan antibiotik pada anjing sel', '08 Abses.jpg'),
(9, 'Eosinophilic Granuloma (Borok)', '', '1.	Siapkan VCO dan Propolis\r\n2.	Oleskan VCO untuk membersihkan kerak hasil infeksi\r\n3.	Tunggu beberapa saat\r\n4.	Oleskan Propolis\r\n', '09 Eosinophilic Granuloma.jpg'),
(10, 'Infeksi Jamur', '', 'Berikan obat oral dan lakukan pembersihan dengan beberapa jenis minyak essensial', '10 Infeksi Jamur.jpg'),
(11, 'Ketombe', '', 'Memberikan suplemen tambahan seperti X trabloom wate dan minyak ikan\r\nLakukan pemandian rutin anjing dalam kurun waktu sebulan sekali dengan sebazole dan sampo anti jamur\r\n', '11 Ketombe.jpg');
